import brandimg1 from './productsimages/brandimageone.png';
import brandimg2 from './productsimages/brandimagetwo.png';
import brandimg3 from './productsimages/brandimagethree.png';
import brandimg4 from './productsimages/brandimageone.png';


const ProductsData = [
    {
        productimg : brandimg1,
    },
    {
        productimg : productimg2,
    },
    {
        productimg : productimg3,
    },
    {
        productimg : productimg4,
    }
]

export default ProductsData;
